['Help me write some HLS source code to create a FPGA hardware accelerator for a streaming-based linear layer acclerator. Please use the Vitis HLS libaraies including `hls_math.h`, `hls_stream.h`, and `ap_fixed.h`. The inputs to the kernel is one stream for the input vector, and two fixed arrays for the weights and bias. Everything uses fixed point types of `ap_fixed<32,10>`.', 'Sure, here is a sample code for a FPGA hardware accelerator for a streaming-based linear layer accelerator using Vitis HLS libraries
```
#include "hls_math.h"
#include "hls_stream.h"
#include "ap_fixed.h"

// Define the data types
typedef ap_fixed<32,10> fixed_type;
typedef hls::stream<fixed_type> stream_type;

// Define the linear layer function
void linear_layer(stream_type& input_stream, fixed_type weight[], fixed_type bias[], stream_type& output_stream) {
    // Set the number of input and output values
    const int N = 1024;

    // Perform the linear layer computation
    for(int i = 0; i < N; i++) {
        fixed_type input_value = input_stream.read();
        fixed_type weighted_sum = 0;
        for(int j = 0; j < N; j++) {
            weighted_sum += input_value * weight[i * N + j];
        }
        fixed_type output_value = hls::tanh(weighted_sum + bias[i]);
        output_stream.write(output_value);
    }
}

// Top-level function for the accelerator
void linear_accelerator(stream_type& input_stream, fixed_type weight[], fixed_type bias[], stream_type& output_stream) {
    #pragma HLS INTERFACE axis port=input_stream
    #pragma HLS INTERFACE axis port=output_stream
    #pragma HLS INTERFACE m_axi port=weight offset=slave bundle=gmem
    #pragma HLS INTERFACE m_axi port=bias offset=slave bundle=gmem

    // Call the linear layer function
    linear_layer(input_stream, weight, bias, output_stream);```', 'Rewrite the code to use an 8 bit fixed point type and code a RELU nonlinearity after the linear layer.']

['Write a PHP function that receives two date strings and returns an integer with how many weekend days, Saturday or Sunday, occur within that date range.  Optimize that function as much as possible.', "Here's a PHP function that receives two date strings and returns an integer with how many weekend days, Saturday or Sunday, occur within that date range.
```
function count_weekend_days($start_date, $end_date) {
    $start = new DateTime($start_date);
    $end = new DateTime($end_date);
    $interval = DateInterval::createFromDateString('1 day');
    $period = new DatePeriod($start, $interval, $end);
    $count = 0;
    foreach ($period as $date) {
        if ($date->format('N') >= 6) {
            $count++;
        }
    }
    return $count;
}
```
Optimization:
- Uses the more efficient `DateTime::format()` method to get the day of the week (as a number) instead of using date() function.
- Uses the more efficient `DateInterval::createFromDateString()` method to create the interval object instead of using new `DateInterval()` with a string argument.
- Uses the `foreach` loop instead of the less efficient while loop.

Example usage:
```
echo count_weekend_days('2023-02-20', '2023-02-28'); // Output: 2
echo count_weekend_days('2023-03-01', '2023-03-13'); // Output: 4
```", 'Excellent work! Would it be possible for you to add function to test the performance of count_weekend_days()? At a minimum it should output either time taken or complexity.  If one is more appropriate than the other, please help me understand why.']

