```
4. Create a GraphQL query to fetch anime titles and ratings:
```
import gql from "graphql-tag";

const ANIME_QUERY = gql`
  query ($perPage: Int!, $page: Int!) {
    Page(perPage: $perPage, page: $page) {
      media(type: ANIME, sort: POPULARITY_DESC) {
        id
        title {
          romaji
          english
        }
        averageScore
      }
    }
  }
`;
```
